function FormName() {
    return (
        <form>
            <div className='FormName'>
                <h2>Add to the list</h2>
                    <label htmlFor='name'>Name:</label>
                    <input type="text" name="name"/>
            </div>
            <div className='FormName'>
                <button />
            </div>
        </form>
    )
}

export default FormName;
